INSERT INTO `teachers` VALUES (1,143,'David','博士',4.9800000,10,'互动式教学, 启发式教学, PCA教学','PhD in NUS',NULL,'男',1,1,0,NULL,'银牌','184,185',1,'小学及以下55新/h, 中学及以上65新/h'),(2,144,'王雅琳','硕士',4.9870000,8,'结构化讲解,例题驱动,思维训练','华师大数学硕士，8年小学数学教学经验。特别擅长应用题教学，帮助学生建立数学思维模式。',NULL,'女',1,1,0,NULL,'王牌','184',1,NULL),(3,145,'张志强','硕士',4.9870000,12,'趣味化教学,互动式,情景引导','南师大数学教育专业，12年教学经验。善于用生动有趣的方式教授数学，让学生爱上数学学习。',NULL,'男',1,0,0,NULL,'王牌','184',1,NULL),(4,146,'陈博士','博士',5.0000000,15,'实验探究,项目制,情景引导','中科院博士，15年科学教育经验。擅长通过实验和观察培养学生科学思维，让抽象的科学概念变得生动有趣。',NULL,'男',1,0,0,NULL,'王牌','184',1,NULL),(5,147,'刘晓敏','硕士',5.0000000,9,'生活化教学,实验探究,互动式','师范大学科学教育专业，专注小学科学教育9年。善于用生活中的例子解释科学原理，激发学生对科学的兴趣。',NULL,'女',1,0,0,NULL,'王牌','184',1,NULL),(6,148,'赵宇航','硕士',5.0000000,7,'探究式,情景浸入,项目制','华师科学教育硕士，7年教学经验。特别擅长环境科学教学，通过户外观察让学生了解自然，培养环保意识。',NULL,'男',1,0,0,NULL,'王牌','184',1,NULL),(7,149,'林雅文','硕士',5.0000000,11,'循序渐进,互动式,游戏化教学','台师大中文硕士，11年小学华文教学经验。擅长拼音和识字教学，让孩子轻松掌握华文基础。',NULL,'女',1,1,0,NULL,'王牌','184',1,NULL),(8,150,'黄志华','硕士',5.0000000,8,'阅读引导,讨论式,启发式','北语汉教硕士，专注小学华文教育8年。特别擅长阅读理解和写作启蒙，培养学生的语言表达能力。',NULL,'男',1,0,0,NULL,'王牌','184',1,NULL),(9,151,'郑美玲','硕士',5.0000000,6,'文化浸润,诵读结合,启发式','港中大中文硕士，6年小学华文教学经验。专注传统文化教育，通过古诗词让孩子感受中华文化魅力。',NULL,'女',1,0,0,NULL,'王牌','184',1,NULL),(10,152,'Emma Wilson','硕士',5.0000000,8,'互动式,任务驱动,沉浸式','英国剑桥大学硕士，专注于KET考试辅导8年。帮助超过200名学生成功通过KET考试，教学风格生动有趣。',NULL,'女',1,1,0,NULL,'王牌','184',1,NULL),(11,153,'David Smith','硕士',5.0000000,6,'轻松互动,任务驱动,情景浸入','美国外教，专业TESOL认证，擅长KET考试技巧指导。课堂氛围轻松愉快，让学生在快乐中学习英语。',NULL,'男',1,0,0,NULL,'王牌','184',1,NULL),(12,154,'Sarah Johnson','硕士',5.0000000,5,'技能导向,任务驱动,反馈导向','澳洲海归教师，专注KET考试培训5年。特别擅长写作和听力训练，学生通过率高达95%。',NULL,'女',1,0,0,NULL,'王牌','184',1,NULL),(13,155,'Michael Brown','硕士',5.0000000,10,'学术导向,探究式,讨论式','牛津大学硕士，10年PET考试辅导经验。专注高级英语教学，帮助学生达到更高的英语水平。',NULL,'男',1,1,0,NULL,'王牌','184',1,NULL),(14,156,'Jennifer Lee','硕士',5.0000000,7,'情景对话,任务驱动,沉浸式','加拿大外教，应用语言学硕士，7年PET教学经验。擅长口语训练和商务英语，让学生自信开口说英语。',NULL,'女',1,0,0,NULL,'王牌','184',1,NULL),(15,157,'Robert Taylor','硕士',5.0000000,9,'苏格拉底式,讨论式,案例教学','美国外教，英语教育硕士，9年教学经验。注重培养学生的批判性思维和英语文学鉴赏能力。',NULL,'男',1,0,0,NULL,'王牌','184',1,NULL),(16,158,'李教授','博士',4.9810000,15,'严谨讲解,问题驱动,强化训练','清华数学博士，15年中学数学教学经验。擅长高等数学和竞赛数学，所教学生多次获得数学竞赛奖项。',NULL,'男',1,1,0,NULL,'王牌','184',1,NULL),(17,159,'王博士','博士',4.9810000,12,'结构化讲解,问题导向,强化训练','北大数学博士，专注中学数学教学12年。特别擅长函数、几何等难点突破，帮助学生建立完整的数学知识体系。',NULL,'女',1,0,0,NULL,'王牌','184',1,NULL),(18,160,'张院士','博士',4.9860000,18,'项目制,情境建模,探究式','中科院博士，18年教学经验。擅长数学建模和创新思维培养，让学生学会用数学解决实际问题。',NULL,'男',1,0,0,NULL,'王牌','184',1,NULL),(19,161,'陈院士','博士',5.0000000,20,'实验探究,严谨求证,问题驱动','中科院物理博士，20年科学教育经验。擅长实验物理教学，培养学生的科学研究能力和创新精神。',NULL,'男',1,1,0,NULL,'王牌','184',1,NULL),(20,162,'刘博士','博士',5.0000000,14,'实验探究,结构化讲解,案例教学','北理工化学博士，14年中学化学教学经验。特别擅长有机化学和实验教学，让抽象的化学概念变得具体可感。',NULL,'女',1,0,0,NULL,'王牌','184',1,NULL),(21,163,'赵教授','博士',5.0000000,16,'探究式,案例教学,学术导向','华科生物博士，16年教学经验。专注分子生物学和生命科学教育，培养学生对生命科学的深度理解。',NULL,'男',1,0,0,NULL,'王牌','184',1,NULL),(22,164,'林教授','博士',5.0000000,17,'经典导读,讨论式,文化浸润','北师大中文博士，17年中学华文教学经验。专精古代文学和文言文，让学生深入理解中华文化精髓。',NULL,'女',1,1,0,NULL,'王牌','184',1,NULL),(23,165,'黄博士','博士',4.9880000,13,'写作工作坊,讨论式,启发式','复旦中文博士，专注中学华文教育13年。擅长现代文学和写作指导，培养学生的文学素养和表达能力。',NULL,'男',1,0,0,NULL,'王牌','184',1,NULL),(24,166,'郑教授','博士',2.0000000,14,'案例分析,结构化讲解,启发式','中大中文博士，14年教学经验。专精语言学和修辞学，帮助学生掌握高级语言运用技巧。',NULL,'女',1,0,0,NULL,'王牌','184',1,''),(37,183,'青','博士',4.9990000,6,'应试强化,结构化讲解,题型训练','博士',NULL,'男',1,1,1,'2025-09-16 13:12:02','王牌','185,184,186',1,NULL);
